    "cryptobox-share-understand-btn": "I understand",
    "cryptobox-share-tc-1": "<b>1. Acceptance of terms and conditions</b>",
    "cryptobox-share-tc-1-1-1": "1.1 These terms and conditions govern your participation in the Binance Pay Share Crypto Red Packet Campaign organized by Binance Pay. By participating in or playing the Binance Pay Share Crypto Red Packet Campaign, you (\u201cyou\u201d or \u201cUser\u201d) agree unconditionally and irrevocably to be bound by, and shall be deemed to accept, these terms and conditions, and the following additional terms: (a) Binance Terms and Conditions for Prize Promotions (<a1>https://www.binance.com/en/pp-terms</a1>); (b) Binance Pay Terms of Use (<a2>https://pay.binance.com/en/terms)</a2>",
    "cryptobox-share-tc-1-1-2": "; (c) Binance Terms of Use (<a3>https://www.binance.com/en/terms</a3>); and (d) Binance Privacy Policy (<a4>https://www.binance.com/en/privacy</a4>); all of which are incorporated by reference into these terms and conditions. If you do not agree to these terms and conditions, please do not access, participate in or play the Binance Pay Share Crypto Red Packet Campaign. For the avoidance of doubt, capitalized terms used and not defined herein have the same meaning as given to such terms in the Binance Terms of Use.",
    "cryptobox-share-tc-1-2": "1.2 In the case of any inconsistency or conflict between these terms and conditions, and any other incorporated terms, the provisions of these Campaign Terms shall prevail, followed by the following in this order of precedence, and to the extent of such conflict: (a) Binance Terms and Conditions for Prize Promotions; (b) Binance Pay Terms of Use; (c) Binance Terms of Use; and (d) Binance Privacy Policy.",
    "cryptobox-share-tc-1-3": "1.3 The rights and protections afforded to Binance under these terms and conditions are in addition and supplemental to the rights and protections afforded to Binance under all the other incorporated terms and conditions mentioned in paragraph 1.1 above (including, without limitation, the Binance Terms and Conditions for Prize Promotions).",
    "cryptobox-share-tc-2": "<b>2. Eligibility</b>",
    "cryptobox-share-tc-2-1": "2.1. A User must also satisfy the following criteria to be eligible to participate in this Binance Pay Share Crypto Red Packet Campaign: (a) User must be a natural person; and (b) User must have passed all Binance and Binance Pay account registration and identity verification/KYC checks (which may include, without limitation, the provision of full name and any other required information in accordance with ID card or passport), and successfully register for Binance and Binance Pay accounts. For clarity, Binance account here refers to a Binance.com account.",
    "cryptobox-share-tc-2-2": "2.2 To participate in the campaign, Users will have to visit the Campaign landing page (or such other landing page as may be specified by us from time to time), log in to their account, create and send a crypto red packet from the campaign to another user. If another user claims the crypto red packet sent by the user successfully, the user will get 1 point.<br/>Users will be entitled to claim rewards of different amounts, depending on how many points the user has earned during the campaign period. The rewards distribution will be in accordance with the Rewards Table set out below:",
    "cryptobox-share-tc-2-3": "2.3 The maximum reward a user can get from the campaign is {{amount}} {{currency}}.",
    "cryptobox-share-tc-2-4": "2.4 The rewards are limited and will be on a first-come, first-served basis.",
    "cryptobox-share-tc-2-5": "2.5 Only the Crypto Red Packet issued from the campaign page will be counted for eligible points for the reward. Regular Crypto Red Packet that issued outside the campaign page will not be counted.",
    "cryptobox-share-tc-2-6": "2.6 Each user can only claim 1 Crypto Red Packet in total from the campaign page during the campaign period. And a user can only claim the Crypto Red Packet issued from the same user once.",
    "cryptobox-share-tc-3": "<b>3. Users are, under no circumstances, permitted to:</b>",
    "cryptobox-share-tc-3-1": "(i) Create or use cheats, mods and/or hacks, or any other third-party software products that may change the result of the Binance Pay Share Crypto Red Packet Campaign; ",
    "cryptobox-share-tc-3-2": "(ii) Use software that allows the mining of data or otherwise intercepts or collects information in connection with the Binance Pay Share Crypto Red Packet Campaign; and",
    "cryptobox-share-tc-3-3": "(iii) sell, buy or trade user accounts or impersonate any other individual in connection with user accounts, and the foregoing shall include all circumventions, similar actions or actions that produce an effect that matches the aforementioned prohibitions.",
    "cryptobox-share-tc-3-4": "(iv) Without limitation to any other rights or remedies that Binance may have under law, Binance may do any one or more of the following if Binance suspects or determines that You (whether alone or with others) have engaged in fraudulent, suspicious or unauthorized activity in connection with this Binance Pay Share Crypto Red Packet Campaign (such activity referred to as \u201cFraud Action\u201d):",
    "cryptobox-share-tc-3-5": "a. Suspend or terminate your Binance account;",
    "cryptobox-share-tc-3-6": "b. Disqualify You from any this Campaign and claw back all points, entitlements and rewards issued by Binance in connection with the Fraud Action;",
    "cryptobox-share-tc-4": "<bspan>4. Binance reserves the right at any time</bspan> in its sole and absolute discretion to determine and/or amend or vary these terms without prior notice, including but not limited to canceling, extending, terminating or suspending this Campaign, its eligibility terms and criteria, the selection and number of winners, and the timing of any act to be done, and all users and participants shall be bound by these amendments. For clarity, Binance's decisions with respect to all aspects of this Campaign are final and non-appealable.",
    "cryptobox-share-tc-5": "<b>5. Risk reminder</b>",
    "cryptobox-share-tc-5-1": "Users confirm that they understand the risks involved in the trading or holding of digital assets (digital currencies, their derivatives or other types of digitalized assets with a certain value) and are recommended to exercise prudence and trade responsibly within their own capabilities. Binance does not take responsibility for any trading behaviours resulting in direct or indirect losses.",
